import React from 'react';
import PropTypes from 'prop-types';

const GoalItem = ({goal: { id, name, duration, startDate }}) => {
  return (
    <a href={`#${id}`}>
      <h3>
        {name}
      </h3>
      <h5>
        Start Date: {startDate}
      </h5>
      <h5>
        Duration: {duration} days
      </h5>
    </a>
  )
};

GoalItem.propTypes = {
  goal: PropTypes.object.isRequired
}

export default GoalItem;
